define('component_data/client-logs-data',['flight/lib/component','text!templates/clientlist.htm','text!templates/dialoglist.htm'],function (defineComponent, clientList, dialogList) {
  
  
  function ClientLogs() {
    this.defaultAttrs({
      clientlisttemp: _.template(clientList),
      dialogsTemp: _.template(dialogList),
   	  log:[]
    });
  this.addClientToLog = function(e,d) {
    this.attr.log.push(d);
    
  };
  this.returnLogs = function(){
    var html = this.attr.clientlisttemp({clients:this.attr.log});
    this.trigger("drawClientLog",{html:html});
  };
  this.returnDialog = function(e,obj){
    var dialog = _.find(this.attr.log,function(o){return o.code === obj.code});
    var html = this.attr.dialogsTemp({dialog:dialog});
    this.trigger("drawDialog",{html:html});

  };

  this.after('initialize', function () {
      this.on("addClientToLog", this.addClientToLog);
      this.on("fetchLogsData", this.returnLogs);
      this.on("fetchDialogsData", this.returnDialog);
  });

  }
  return defineComponent(ClientLogs);
});


define('component_ui/client-logs-ui',['flight/lib/component'],function (defineComponent) {
  
  
  function ClientLogsUi() {
    this.defaultAttrs({
      'client':'li'
    });
  this.loadClientLog = function(){
    this.trigger(document,'fetchLogsData');
  };
  this.drawClientLog = function(e, obj){
    this.$node.find('.clientlist').empty().append(obj.html);
  };
  this.drawDiaLog = function(e, obj){
    this.$node.find('.dialog').empty().append(obj.html);
  };
  this.loadDialog = function(e, obj){
    var code = obj.el.dataset.code;
    this.trigger(document,'fetchDialogsData', {code:code});

  };
  this.after('initialize', function () {
    this.on(document,"loadClientLog", this.loadClientLog);
    this.on(document,"drawClientLog", this.drawClientLog);
    this.on(document,"drawDialog", this.drawDiaLog);
    this.on(this.$node,'click',{
      'client': this.loadDialog
    })
  });

  }
  return defineComponent(ClientLogsUi);
});


